INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1001, "春咲 ひより", 1.4, 0, 1, "お！\nあそこに困ってそうな人発見！", 0, 2, 1, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1002, "草野 優衣", 1.4, 0, 1, "大切な人を\n守れるようになりたい…って", 0, 2, 1, 0, "みんなみたいに\nわたしも強くならなきゃ", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "少しは磨かれると思いますよ。", 1003, "士条 怜", 1.4, 0, 1, "キミに必要な集中力と感性が", 0, 2, 1, 0, "フェンシングを始めてみては？", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 1004, "穂高 みそぎ", 1.5, 0, 1, "今日はなにして遊ぶ？", 0, 2, 1, 0, "ねぇ、にいちゃん！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "私といっしょに…\nいかない？", 1006, "風宮 あかり", 1.4, 0, 1, "ねぇ…", 0, 2, 1, 0, "風宮あかりです", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "食べ物の恨みは怖いのー", 1007, "出雲 宮子", 1.5, 0, 1, "プリンたべたいのー", 0, 2, 1, 0, "出雲宮子なのー", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "いいよ。\n見られることは運命さ…", 1008, "虹村 雪", 1.4, 0, 1, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 2, 1, 0, "ボクは虹村雪。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "人呼んで「疾風の冥姫」!!", 1009, "柊杏奈", 1.4, 0, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 2, 1, 0, "フッ…聞いて後悔するがいい！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "ほんまおおきにやわ～♪", 1010, "姫宮 真歩", 1.5, 0, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 2, 1, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "ここで会ったが\n100年目～！", 1011, "衣之咲 璃乃", 1.4, 0, 1, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 2, 1, 0, "衣之咲璃乃です！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "…って、お願い！\n誰にも言わないでおいて～！", 1012, "柏崎 初音", 1.4, 0, 1, "ち、超能力って…\n何のことかな～？", 0, 2, 1, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1016, "美波 鈴奈", 1.4, 0, 1, "一応カリスマ読モJKやってまっす！", 0, 2, 1, 0, "ちょす！\n美波鈴奈だよ～♪", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "でも、沖縄もとってもいいとこさー", 1017, "喜屋武 香織", 1.4, 0, 1, "東京は遊園地みたいなところさー", 0, 2, 1, 0, "はいたーい。\n喜屋武香織さー。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "イオちゃんって呼んでね。", 1018, "支倉 伊緒", 1.4, 0, 1, "先生って呼ばれるのは\nくすぐったいから", 0, 2, 1, 0, "支倉伊緒です。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "ミミをおいてかないでぇ～", 1020, "茜 ミミ", 1.5, 0, 1, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 2, 1, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "ふぇぇぇぇぇん……", 1021, "栗林 くるみ", 1.5, 0, 1, "あの……\nふぇ……", 0, 2, 1, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "なんてありがとうございます！", 1022, "風宮 より", 1.4, 0, 1, "こんな私に貴重な時間を\n割いていただき、", 0, 2, 1, 0, "風宮よりです。\nあああああ！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "私こっち行きたいー\nね、早く早くー", 1023, "北条 綾音", 1.5, 0, 1, "おにいちゃんどこいくの？\nえ？", 0, 2, 1, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "これて何か違う…\nあああすみません！", 1025, "天野 すずめ", 1.4, 0, 1, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 2, 1, 0, "わっ…わっ…私、\n天野すずめといいます！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "離しませんわ………\n絶対に…!!", 1027, "倉石 恵理子", 1.4, 0, 1, "あなたは…運命の……\n伴侶……", 0, 2, 1, 0, "……クスクス…私は\n…倉石恵理子……", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "…そうでしょ？？", 1028, "佐々木 咲恋", 1.4, 0, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 2, 1, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "あはは、\n私もまだまだだなぁ～", 1029, "桜井 望", 1.4, 0, 1, "ぇっと…\nキミ、私のこと知らないの?!", 0, 2, 1, 0, "桜井望だよ！\nよろしくねっ", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 1030, "ニノン・ジュベール", 1.4, 0, 1, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 2, 1, 0, "デケデケデンっ！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "おかしいですね……", 1031, "上喜 しのぶ", 1.4, 0, 1, "でもって私の隣にいるのが……\nえ、見えない？", 0, 2, 1, 0, "上喜しのぶです。\n手元のドクロが父です。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "そう、\nオラのボケに突っ込める相方が…！", 1033, "野戸まひる", 1.5, 0, 1, "けんども\nそれには足りないモンが…", 0, 2, 1, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "ちょ\nちょっと一杯飲んできます…！", 1034, "綾瀬 ゆかり", 1.4, 0, 1, "ちょっと緊張しちゃって…", 0, 2, 1, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "これ以上お話しすることは…\nないです！", 1036, "氷川 鏡華", 1.5, 0, 1, "知らない人とは話しちゃいけないので", 0, 2, 1, 0, "氷川鏡華…です", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1038, "柏崎 栞", 1.4, 0, 1, "……あ、アラーム。", 0, 2, 1, 0, "柏崎…栞です。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "野に咲く花が、\n唯一の話相手です。", 1040, "双葉 碧", 1.4, 0, 1, "私、一人も友達がいなくて……", 0, 2, 1, 0, "ふ、双葉碧です。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "そう思っています。", 1042, "三角 千歌", 1.4, 0, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 2, 1, 0, "三角千歌です。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "う、疑ってすまなかったな…", 1043, "安芸 真琴", 1.4, 0, 1, "あぁ？\nお前のそいつの仲間か？", 0, 2, 1, 0, "安芸真琴だ。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1044, "イリヤ・オーンスタイン", 1.4, 0, 1, "生けとし生ける全ての者よ！", 0, 2, 1, 0, "わらわこそは夜を総べる者！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "ｌク、クウカに何かご用ですか!?", 1045, "遠見 空花", 1.4, 0, 1, "ぐふふふふ……はっ！", 0, 2, 1, 0, "そこで騎士は妖精を乱暴に……", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 1046, "宮坂たまき", 1.4, 0, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 2, 1, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1048, "大神 美冬", 1.4, 0, 1, "それでは早速クエストに…", 0, 2, 1, 0, "大神美冬よ！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1049, "星野静流", 1.4, 0, 1, "クエストもバトルも\n掃除も洗濯も", 0, 2, 1, 0, "星野静流だよ！", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1050, "玉泉美咲", 1.5, 0, 1, "見ての通りの\nセクシー美少女で", 0, 2, 1, 0, "アタシは玉泉美咲。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "？？？？", 1052, "リマ", 1.4, 0, 1, "？？？？", 0, 2, 1, 0, "？？？", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "そ、そこまでいうなら\nもらってやる", 1053, "モニカ・ヴァイスヴィント", 1.5, 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 2, 1, 0, "モニカ・ヴァイスヴィントだ。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "そ、そこまでいうなら\nもらってやる", 1058, "ペコリーヌ", 1.5, 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 2, 1, 0, "モニカ・ヴァイスヴィントだ。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "そ、そこまでいうなら\nもらってやる", 1059, "コッコロ", 1.5, 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 2, 1, 0, "モニカ・ヴァイスヴィントだ。", 1);
INSERT INTO `v1_e01dc5a1500155de62fe4da01473c7cefac07c3da833817a309ed9d746529839` VALUES (0, 0, "そ、そこまでいうなら\nもらってやる", 1060, "キャル", 1.5, 0, 1, "菓子でつろうなどと\n稚拙な策を……", 0, 2, 1, 0, "モニカ・ヴァイスヴィントだ。", 1);
